DELIMITER $$

/*!50106 CREATE DEFINER=`root`@`localhost` EVENT `ejecutar_add_tb_credit_agency1` ON SCHEDULE EVERY 1 MONTH STARTS '2017-12-01 00:00:00' ON COMPLETION NOT PRESERVE ENABLE COMMENT 'Ejecutar adicion de abonos mensual en saldo de agencias' DO CALL `add_tb_credit_agency1`() */$$
DELIMITER ;

/* Procedure structure for procedure `add_tb_credit_agency1` */

/*!50003 DROP PROCEDURE IF EXISTS  `add_tb_credit_agency1` */;

DELIMITER $$

/*!50003 CREATE DEFINER=`root`@`localhost` PROCEDURE `add_tb_credit_agency1`()
BEGIN
DECLARE idAgency INT;
DECLARE valueCredit FLOAT;
DECLARE fecha TIMESTAMP;
DECLARE nameCredit VARCHAR(25);
DECLARE fin INTEGER DEFAULT 0;
DECLARE cursor1 CURSOR FOR 
SELECT a.idAgency,b.valueCredit,b.nameCredit FROM db_asnube.tb_agency as a
inner  join  db_asnube.tb_credit as  b on b.idCredit=a.idCreditFk
where a.statuAgency=1;
DECLARE CONTINUE HANDLER FOR NOT FOUND SET fin=1;
OPEN cursor1;
	get_idAgencys: LOOP
		FETCH cursor1 INTO idAgency,valueCredit,nameCredit;
		IF fin = 1 THEN
		   LEAVE get_idAgencys;
		END IF;
		set fecha = now();
		-- Insertar en la tabla tb_credit_agency
        SET 
        idAgencyFk=idAgency,
        abono=valueCredit,
		nameCredit=nameCredit,
        fecha=fecha;
		
	END LOOP get_idAgencys;
CLOSE cursor1;
END */$$
DELIMITER ;

