(75,'El modo de trabajar de Kollcar es que los viajes siempre se calculan desde su base que es UNICENTER, es decir, si un viaje es de Palermo a Aeroparque. Ellos calculan en Kilometros el precio desde UNICENTER a Palermo y de Palermo a Aeroparque. B√°sicamente sus viajes tienen dos origenes, el de la base al origen del viaje y del origen al destino. \n\nAdem√°s ellos necesitan que en la App del chofer s√≥lo muestre el Origen y el destino del viaje como se muestra habitualmente. Ya que, si se muestra que salen de la base estos se ir√°n hasta la base para salir y eso es s√≥lo a efectos de kilometraje para luego tarifar. ',-1,10,47,'valentina@apreciasoft.com','valentina@apreciasoft.com','URGENTE - Base Unicenter ','Estimados,\nDeben configurar desde El DH Empresas, la BASE pactada y luego seleccionaerla al momento de cargar un viaje!\nSaludos!',0,'2017-10-31 13:31:27','2017-10-31 20:11:48',NULL,'TK-000074',0,NULL),
